import React from 'react';
import Header from 'features/common/components/Header'
import Footer from 'features/common/components/Footer'

import 'features/map/style/Map.css'
import { LocalMap, LocalMapInFo } from "features/map/components"


const MapLayOut = (props) => {
  return (
    <div class = "wrapper">
      <div class="container">
        <span class ="item1"><Header/></span>

        <span class ="item14"><LocalMap/>지도</span>
        <span class ="item15"><LocalMapInFo/>진료소A</span>

        <span class ="item2"><Footer/></span>
      </div>
    </div>
  );
}

export default MapLayOut;
